{
    a.setX = one.getX;
    a.setY = one.getY;
    b.setX = two.getX;
    b.setY = two.getY;
}

float Line::length()
{
    int x1,y1,x2,y2;
    float linelength;

    x1 = a.getX;
    y1 = a.getY;
    x2 = b.getX;
    y2 = b.getY;

    linelength = ((x2-x1)*(x2-x1)) + ((y2-y1)*(y2-y1));
    linelength = sqrtf(linelength);

    return linelength;
}

